// This function gets the name of a token as a string
let token_to_string (t:token) = 
  match t with 
  | SYMBOL _ -> "SYMBOL" 
  | KEYWORD _ -> "KEYWORD" 
  | RAWSTRING _ -> "RAWSTRING" 
  | DOT_METHOD _ -> "DOT_METHOD" 
  | APPLY_METHOD _ -> "APPLY_METHOD" 
  | STRING _ -> "STRING" 
  | CHAR _ -> "CHAR" 
  | MACRO_NAME _ -> "MACRO_NAME" 
  | PROP_PLUS _ -> "PROP_PLUS" 
  | HASH_IDENT _ -> "HASH_IDENT" 
  | DECIMAL _ -> "DECIMAL" 
  | IEEE64 _ -> "IEEE64" 
  | IEEE32 _ -> "IEEE32" 
  | UNATIVEINT _ -> "UNATIVEINT" 
  | UINT64 _ -> "UINT64" 
  | UINT32 _ -> "UINT32" 
  | UINT16 _ -> "UINT16" 
  | UINT8 _ -> "UINT8" 
  | NATIVEINT _ -> "NATIVEINT" 
  | INT64 _ -> "INT64" 
  | INT32 _ -> "INT32" 
  | INT32_DOT_DOT _ -> "INT32_DOT_DOT" 
  | INT16 _ -> "INT16" 
  | INT8 _ -> "INT8" 
  | RETURN _ -> "RETURN" 
  | YIELD _ -> "YIELD" 
  | INLINE  -> "INLINE" 
  | REC  -> "REC" 
  | RINIT  -> "RINIT" 
  | THREAD_FIRST  -> "THREAD_FIRST" 
  | THREAD_LAST  -> "THREAD_LAST" 
  | SYNTAX_MACRO  -> "SYNTAX_MACRO" 
  | SEQ  -> "SEQ" 
  | UNION  -> "UNION" 
  | ATOM_KW  -> "ATOM_KW" 
  | DEREF_KW  -> "DEREF_KW" 
  | WHILE  -> "WHILE" 
  | TYPE  -> "TYPE" 
